import React from "react";

export default function ClientePerfil() {
  return (
    <div className="container py-8">
      <h1 className="text-2xl font-bold mb-6">Perfil do Cliente</h1>
      <section className="mb-8">
        <h2 className="text-xl font-semibold mb-2">Dados do Cliente</h2>
        {/* Exibir dados do cliente aqui */}
        <div className="bg-white rounded-lg shadow p-4">
          Dados do cliente...
        </div>
      </section>
      <section className="mb-8">
        <h2 className="text-xl font-semibold mb-2">Assinatura</h2>
        {/* Exibir dados da assinatura aqui */}
        <div className="bg-white rounded-lg shadow p-4">
          Dados da assinatura...
        </div>
      </section>
      <section>
        <h2 className="text-xl font-semibold mb-2">Configurações</h2>
        {/* Exibir configurações do cliente aqui */}
        <div className="bg-white rounded-lg shadow p-4">
          Configurações do cliente...
        </div>
      </section>
    </div>
  );
}
